// ProductItem.js
import React from 'react';

export default function ProductItem() {
  // Define products array
  const products = [
    {
      name: "Winter Sweater",
      image: "https://images.pexels.com/photos/54203/pexels-photo-54203.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500",
      price: 60,
      tag: "sale",
      rating: 5,
    },
    {
      name: "Denim Dress",
      image: "https://images.pexels.com/photos/6764040/pexels-photo-6764040.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500",
      price: 55,
      tag: "out of stock",
      rating: 4,
    },
  ];

  return (
    <div className="row">
      {products.map((product, index) => {
        const { name, image, price, tag, rating } = product;

        return (
          <div
            key={index}
            className="col-lg-3 col-sm-6 d-flex flex-column align-items-center justify-content-center product-item my-3"
          >
            <div className="product position-relative">
              <img src={image} alt={name} className="img-fluid" />
              <ul className="d-flex align-items-center justify-content-center list-unstyled icons position-absolute">
                <li className="icon">
                  <span className="fas fa-expand-arrows-alt"></span>
                </li>
                <li className="icon mx-3">
                  <span className="far fa-heart"></span>
                </li>
                <li className="icon">
                  <span className="fas fa-shopping-bag"></span>
                </li>
              </ul>
            </div>

            {tag && (
              <div className={`tag ${tag === "sale" ? "bg-red" : "bg-black"}`}>
                {tag}
              </div>
            )}

            <div className="title pt-4 pb-1">{name}</div>

            <div className="d-flex align-content-center justify-content-center">
              {[...Array(rating)].map((_, i) => (
                <span key={i} className="fas fa-star"></span>
              ))}
            </div>

            <div className="price">${price}</div>
          </div>
        );
      })}
    </div>
  );
}
